import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

function Navbar() {
  const { currentUser, userProfile, logout } = useAuth();
  const location = useLocation();

  const isActive = (path) => location.pathname === path;

  const handleLogout = async () => {
    try {
      await logout();
    } catch (error) {
      console.error('Error logging out:', error);
    }
  };

  const getRoleColor = (role) => {
    switch (role) {
      case 'ngo': return 'bg-gradient-to-r from-green-400 to-emerald-500 text-white shadow-lg shadow-green-500/25';
      case 'startup': return 'bg-gradient-to-r from-blue-400 to-cyan-500 text-white shadow-lg shadow-blue-500/25';
      case 'government': return 'bg-gradient-to-r from-purple-400 to-violet-500 text-white shadow-lg shadow-purple-500/25';
      default: return 'bg-gradient-to-r from-gray-400 to-slate-500 text-white shadow-lg shadow-gray-500/25';
    }
  };

  return (
    <nav className="bg-white/80 backdrop-blur-lg shadow-xl border-b border-white/20 sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          <div className="flex items-center">
            <Link to="/" className="flex items-center space-x-3 hover:opacity-80 transition-opacity cursor-pointer">
              <img 
                src="/favicon.png" 
                alt="SDG Bridge Logo" 
                className="h-10 w-10 object-contain"
              />
              <div className="text-2xl font-bold text-primary-600">SDG Bridge</div>
            </Link>

            {currentUser && (
              <div className="hidden md:ml-8 md:flex md:space-x-8">
                <Link
                  to="/dashboard"
                  className={`inline-flex items-center px-1 pt-1 text-sm font-medium border-b-2 ${
                    isActive('/dashboard')
                      ? 'border-primary-500 text-primary-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                >
                  Dashboard
                </Link>
                <Link
                  to="/projects"
                  className={`inline-flex items-center px-1 pt-1 text-sm font-medium border-b-2 ${
                    isActive('/projects')
                      ? 'border-primary-500 text-primary-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                >
                  Browse Projects
                </Link>
                <Link
                  to="/post-project"
                  className={`inline-flex items-center px-1 pt-1 text-sm font-medium border-b-2 ${
                    isActive('/post-project')
                      ? 'border-primary-500 text-primary-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                >
                  Post Project
                </Link>
                <Link
                  to="/communications"
                  className={`inline-flex items-center px-1 pt-1 text-sm font-medium border-b-2 ${
                    isActive('/communications')
                      ? 'border-primary-500 text-primary-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                >
                  Communications
                </Link>
              </div>
            )}
          </div>

          <div className="flex items-center space-x-4">
            {!currentUser && (
              <div className="flex items-center space-x-4">
                <Link
                  to="/"
                  className="text-gray-600 hover:text-blue-600 font-medium transition-colors"
                >
                  Home
                </Link>
                <Link
                  to="/projects"
                  className="text-gray-600 hover:text-blue-600 font-medium transition-colors"
                >
                  Explore Projects
                </Link>
                <Link
                  to="/login"
                  className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-colors"
                >
                  Login
                </Link>
              </div>
            )}

            {currentUser && (
              <>
                {userProfile?.role && (
                  <span className={`px-2 py-1 text-xs font-medium rounded-full ${getRoleColor(userProfile.role)}`}>
                    {userProfile.role.toUpperCase()}
                  </span>
                )}

                <div className="flex items-center space-x-3">
                  {currentUser?.photoURL && (
                    <img
                      className="h-8 w-8 rounded-full"
                      src={currentUser.photoURL}
                      alt={currentUser.displayName}
                    />
                  )}
                  <span className="text-sm font-medium text-gray-700">
                    {currentUser?.displayName}
                  </span>
                  <button
                    onClick={handleLogout}
                    className="text-sm text-gray-500 hover:text-gray-700 transition-colors"
                  >
                    Logout
                  </button>
                </div>
              </>
            )}
          </div>
        </div>
      </div>

      {/* Mobile menu */}
      <div className="md:hidden">
        <div className="pt-2 pb-3 space-y-1">
          <Link
            to="/"
            className={`block pl-3 pr-4 py-2 text-base font-medium ${
              isActive('/')
                ? 'bg-primary-50 border-r-4 border-primary-500 text-primary-700'
                : 'text-gray-600 hover:text-gray-800 hover:bg-gray-50'
            }`}
          >
            Dashboard
          </Link>
          <Link
            to="/projects"
            className={`block pl-3 pr-4 py-2 text-base font-medium ${
              isActive('/projects')
                ? 'bg-primary-50 border-r-4 border-primary-500 text-primary-700'
                : 'text-gray-600 hover:text-gray-800 hover:bg-gray-50'
            }`}
          >
            Browse Projects
          </Link>
          <Link
            to="/post-project"
            className={`block pl-3 pr-4 py-2 text-base font-medium ${
              isActive('/post-project')
                ? 'bg-primary-50 border-r-4 border-primary-500 text-primary-700'
                : 'text-gray-600 hover:text-gray-800 hover:bg-gray-50'
            }`}
          >
            Post Project
          </Link>
          <Link
            to="/communications"
            className={`block pl-3 pr-4 py-2 text-base font-medium ${
              isActive('/communications')
                ? 'bg-primary-50 border-r-4 border-primary-500 text-primary-700'
                : 'text-gray-600 hover:text-gray-800 hover:bg-gray-50'
            }`}
          >
            Communications
          </Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
